import styled from 'styled-components';
import {
  Colors,
  FontFamilies,
  FontWeights,
  FontSizes,
} from '../../shared/DesignTokens';

export const TextOne = styled.p`
font-family: ${FontFamilies.PRIMARY};
font-size: ${FontSizes.THREE};
font-weight: ${FontWeights.REGULAR};
color: ${Colors.BLACK};

`;
